function App() {

  const [searchQuery, setSearchQuery] = useState('');

  return (
    <div className="App">
      Auto-Schedule
      <SearchBar 
        searchQuery = {searchQuery}
        setSearchQuery = {setSearchQuery}/>
      <SearchList />
      <div>
        {searchQuery}
      </div>
    </div>

  );
}

export default App;
